import React, { Fragment} from 'react';
import Header from './componentes/Header'
import Formulario from './componentes/Formulario'
//Redux Hooks

function App() {
  return (
    <Fragment className="App">
      <Header
        titulo="Clima App"
      />
      <Formulario/>
    </Fragment>
  );
}

export default App;
